srcDoc.css:
/* Ensure no scrollbars */
html, body {
  margin: 0;
  padding: 0;
  height: 100%;
  width: 100%;
  overflow: hidden;
}

#appsmith-widget {
  width: 100%;
  height: 100%;
  position: relative;
  overflow: hidden; /* Prevent any overflow, no scrollbars */
}

.image-container {
  width: 100%;
  height: 100%;
  position: relative;
  overflow: hidden; /* Prevent overflow */
}

#base64-image {
  position: absolute;
  top: 50%;
  left: 50%;
  width: auto;
  height: auto;
  min-width: 100%;
  min-height: 100%;
  transform: translate(-50%, -50%);
  object-fit: cover; /* Ensures the image fills the widget while maintaining aspect ratio */
}

.overlay-text {
  position: absolute;
  width: 90%;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  color: white;
  font-size: 12px; /* Base size for normal text */
  font-weight: normal; /* Normal weight for regular text */
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.7); /* Shadow for better text readability */
  z-index: 10;
  text-align: center;
}

.overlay-text strong {
  font-weight: bold; /* Bold for the first and last lines */
  font-size: 25px; /* Larger size for the first and last lines */
}

.overlay-text strong-link {
  font-weight: bold; /* Bold for the first and last lines */
  font-size: 25px; /* Larger size for the first and last lines */
  color: yellow;
  cursor: pointer;
}

.overlay-text h2 {
  margin: 0;
  padding: 0;
}

/* Blurred circle behind the text */
.blur-circle {
  position: absolute;
  top: 50%;
  left: 50%;
  width: 70%;
  height: 70%;
  background: radial-gradient(circle, rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0) 70%);
  transform: translate(-50%, -50%);
  border-radius: 50%;
  z-index: 5; /* Behind the text, but above the image */
  filter: blur(10px);
}

